import React from 'react'
import User from './User';

function Users() {
    const users = [
        {id:1,name:"akash"},
        {id:1,name:"koushik"},
        {id:1,name:"radika"}
    ];
  return (
    <div>
        users.map((user)=>{
            <User id={user.id} name={user.name}/>
        });
    </div>
  )
}

export default Users
